import React from 'react'
import Product from '.components/Product';



const Products = () => {

    const products = getProducts()

    const listProducts = products.map((product) =>
        <Product key={product.productName} data={product} />
    );

    return (
        <div>
            <ul>{listProducts}</ul>
        </div>
    );

}

export default Products;
